function getColor(d) {
    return d > 1000 ? '#800026' :
           d > 500  ? '#BD0026' :
           d > 200  ? '#E31A1C' :
           d > 100  ? '#FC4E2A' :
           d > 50   ? '#FD8D3C' :
           d > 20   ? '#FEB24C' :
           d > 10   ? '#FED976' :
                      '#FFEDA0';
}

var geojsonMarkerOptions = {
    radius: 6,
    fillColor: "#fafc83",
    color: "#000",
    weight: 0.5,
    opacity: 1,
    fillOpacity: 1
};

var geojsonPolyOptions = {
  weight: 3,
  fillColor: "#e63e5a",
  color: "#ffe3e8",
  fillOpacity: 0.8
};

// highlight function
var highlightFeature = function(e){
  var layer = e.target;
  layer.setStyle({
    weight:5,
    color:"#facf6b",
    dashArray: '',
    fillOpacity:1
  });
}

var resetHighlight = function(e){
  layer1.resetStyle(e.target)
}

function onEachFeature(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
      mouseout: resetHighlight,
        //click: zoomToFeature
    });
}


var layer = L.geoJSON(campsites,{ pointToLayer: function (feature, latlng) {
        return L.circleMarker(latlng, geojsonMarkerOptions);
    } }).bindTooltip(layer => ` <b>Campsites</b>
   <br><b>Name</b>:  ${layer.feature.properties.Campsite}</br>
   <br><b>District</b>:  ${layer.feature.properties.DISTRICT}</br>`,
  {permanent: false,
    offset: [-50, -60],
    direction: "right",
}).addTo(map);



var layer1 =L.geoJson(camping_zone, { style: geojsonPolyOptions, onEachFeature: onEachFeature}).bindTooltip(layer => `<b>Trails</b>
<br><b>Camp zone name</b>:  ${layer.feature.properties.NAME}</br>
<br><b>Area</b>:  ${layer.feature.properties.SHAPE_Area}</br>`,
  {permanent: false,
    offset: [-50, -60],
    direction: "right",
}).addTo(map);
